std::string longest(std::vector<std::string> strings) {
    if (strings.empty()) {
        return "";
    }

    int maxlen = 0;
    for (const std::string& s : strings) {
        maxlen = std::max(maxlen, static_cast<int>(s.length()));
    }

    for (const std::string& s : strings) {
        if (s.length() == maxlen) {
            return s;
        }
    }

    return "";
}

