bool is_palindrome(string str) {
    string reversed(str.rbegin(), str.rend());
    return reversed == str;
}

string make_palindrome(string str) {
    if (str.empty()) {
        return "";
    }

    int beginning_of_suffix = 0;

    while (!is_palindrome(str.substr(beginning_of_suffix))) {
        beginning_of_suffix++;
    }

    return str + string(str.begin(), str.begin() + beginning_of_suffix);
}

#undef NDEBUG
#include<assert.h>
int main(){
    assert (make_palindrome("") == "");
    assert (make_palindrome("x") == "x");
     assert (make_palindrome("xyz") == "xyzyx");
     assert (make_palindrome("xyx") == "xyx") ;
     assert (make_palindrome("jerry") == "jerryrrej");
}

