using namespace std;

vector<float> rescale_to_unit(vector<float> numbers) {
    float min_number = numbers[0];
    float max_number = numbers[0];

    // Find the minimum and maximum numbers in the input list
    for (float num : numbers) {
        if (num < min_number) {
            min_number = num;
        }
        if (num > max_number) {
            max_number = num;
        }
    }

    vector<float> rescaled_numbers;

    // Apply linear transformation to rescale the numbers
    for (float num : numbers) {
        float rescaled_num = (num - min_number) / (max_number - min_number);
        rescaled_numbers.push_back(rescaled_num);
    }

    return rescaled_numbers;
}

