int prime_fib(int n) {
    auto is_prime = [](int p) {
        if (p < 2) {
            return false;
        }
        for (int k = 2; k * k <= p; k++) {
            if (p % k == 0) {
                return false;
            }
        }
        return true;
    };

    std::vector<int> f = {0, 1};
    while (true) {
        f.push_back(f.back() + f[f.size() - 2]);
        if (is_prime(f.back())) {
            n--;
        }
        if (n == 0) {
            return f.back();
        }
    }
}

