vector<float> sort_even(vector<float> l) {
    vector<float> evens;
    vector<float> odds;
    vector<float> ans;

    for (int i = 0; i < l.size(); i++) {
        if (i % 2 == 0) {
            evens.push_back(l[i]);
        } else {
            odds.push_back(l[i]);
        }
    }

    sort(evens.begin(), evens.end());

    for (int i = 0; i < evens.size(); i++) {
        ans.push_back(evens[i]);
        ans.push_back(odds[i]);
    }

    if (evens.size() > odds.size()) {
        ans.push_back(evens.back());
    }

    return ans;
}

