int fib4(int n) {
    int results[4] = {0, 0, 2, 0};
    if (n < 4) {
        return results[n];
    }

    for (int i = 4; i <= n; i++) {
        int next = results[0] + results[1] + results[2] + results[3];
        results[0] = results[1];
        results[1] = results[2];
        results[2] = results[3];
        results[3] = next;
    }

    return results[3];
}

