int largest_prime_factor(int n) {
    int largest = 1;
    for (int j = 2; j <= n; j++) {
        if (n % j == 0) {
            bool isPrime = true;
            for (int i = 2; i <= sqrt(j); i++) {
                if (j % i == 0) {
                    isPrime = false;
                    break;
                }
            }
            if (isPrime) {
                largest = std::max(largest, j);
            }
        }
    }
    return largest;
}

