int fruit_distribution(string s, int n) {
    int apples = 0;
    int oranges = 0;
    for (int i = 0; i < s.size(); i++) {
        if (isdigit(s[i])) {
            int num = 0;
            while (i < s.size() && isdigit(s[i])) {
                num = num * 10 + (s[i] - '0');
                i++;
            }
            if (s[i] == 'a') {
                apples = num;
            } else if (s[i] == 'o') {
                oranges = num;
            }
        }
    }
    return n - apples - oranges;
}

