using namespace std;
vector<int> pluck(vector<int> arr){
    vector<int> result = {};
    if(arr.empty()) return result;

    vector<int> evens;
    for(int i=0; i<arr.size(); i++){
        if(arr[i] % 2 == 0){
            evens.push_back(arr[i]);
        }
    }

    if(evens.empty()) return result;

    int min_even = evens[0];
    int min_index = 0;
    for(int i=1; i<evens.size(); i++){
        if(evens[i] < min_even){
            min_even = evens[i];
            min_index = i;
        }
    }

    for(int i=0; i<arr.size(); i++){
        if(arr[i] == min_even){
            min_index = i;
            break;
        }
    }

    result.push_back(min_even);
    result.push_back(min_index);

    return result;
}

