string encrypt(string s) {
    string alphabet = "abcdefghijklmnopqrstuvwxyz";
    string output = "";
    for (char c : s) {
        if (isalpha(c)) {
            int index = alphabet.find(tolower(c));
            int new_index = (index + 2 * 2) % 26;
            output += islower(c) ? alphabet[new_index] : toupper(alphabet[new_index]);
        } else {
            output += c;
        }
    }
    return output;
}

