int next_smallest(vector<int> lst){
    if (lst.size() < 2) {
        return NULL;
    }
    sort(lst.begin(), lst.end());
    vector<int> unique_lst;
    unique_lst.push_back(lst[0]);
    for (int i = 1; i < lst.size(); i++) {
        if (lst[i] != lst[i - 1]) {
            unique_lst.push_back(lst[i]);
        }
    }
    if (unique_lst.size() < 2) {
        return NULL;
    }
    return unique_lst[1];
}

