bool check_dict_case(std::map<std::string, std::string> dict) {
    if (dict.empty()) {
        return false;
    } else {
        std::string state = "start";
        for (const auto& pair : dict) {
            const std::string& key = pair.first;
            if (!std::all_of(key.begin(), key.end(), ::isalpha)) {
                state = "mixed";
                break;
            }
            if (state == "start") {
                if (std::all_of(key.begin(), key.end(), ::islower)) {
                    state = "lower";
                } else if (std::all_of(key.begin(), key.end(), ::isupper)) {
                    state = "upper";
                } else {
                    break;
                }
            } else if ((state == "upper" && !std::all_of(key.begin(), key.end(), ::isupper)) || (state == "lower" && !std::all_of(key.begin(), key.end(), ::islower))) {
                state = "mixed";
                break;
            } else {
                break;
            }
        }
        return state == "upper" || state == "lower";
    }
}

#undef NDEBUG
#include<assert.h>
int main(){
    assert (check_dict_case({{"p","pineapple"}, {"b","banana"}}) == true);
    assert (check_dict_case({{"p","pineapple"}, {"A","banana"}, {"B","banana"}}) == false);
    assert (check_dict_case({{"p","pineapple"}, {"5","banana"}, {"a","apple"}}) == false);
    assert (check_dict_case({{"Name","John"}, {"Age","36"}, {"City","Houston"}}) == false);
    assert (check_dict_case({{"STATE","NC"}, {"ZIP","12345"} }) == true  );
    assert (check_dict_case({{"fruit","Orange"}, {"taste","Sweet"} }) == true  );
    assert (check_dict_case({}) == false);
}

