    for (int num : n) {
        int sum = 0;
        int neg = 1;
        if (num < 0) {
            num *= -1;
            neg = -1;
        }
        while (num != 0) {
            sum += num % 10;
            num /= 10;
        }
        if (sum * neg > 0) {
