std::map<char, int> histogram(std::string test) {
    std::map<char, int> result;
    std::istringstream iss(test);
    std::string word;

    while (iss >> word) {
        for (char c : word) {
            result[c]++;
        }
    }

    int maxCount = 0;
    for (const auto& pair : result) {
        if (pair.second > maxCount) {
            maxCount = pair.second;
        }
    }

    std::map<char, int> maxFrequencyChars;
    for (const auto& pair : result) {
        if (pair.second == maxCount) {
            maxFrequencyChars[pair.first] = pair.second;
        }
    }

    return maxFrequencyChars;
}

