vector<string> select_words(string s, int n){
    vector<string> result;
    string word = "";
    for (int i = 0; i < s.size(); i++) {
        if (s[i] == ' ') {
            int n_consonants = 0;
            for (char c : word) {
                if (tolower(c) != 'a' && tolower(c) != 'e' && tolower(c) != 'i' && tolower(c) != 'o' && tolower(c) != 'u') {
                    n_consonants++;
                }
            }
            if (n_consonants == n) {
                result.push_back(word);
            }
            word = "";
        } else {
            word += s[i];
        }
    }
    int n_consonants = 0;
    for (char c : word) {
        if (tolower(c) != 'a' && tolower(c) != 'e' && tolower(c) != 'i' && tolower(c) != 'o' && tolower(c) != 'u') {
            n_consonants++;
        }
    }
    if (n_consonants == n) {
        result.push_back(word);
    }
    return result;
}

