using namespace std;

bool check(string s) {
    int val = 0;
    for (char i : s) {
        if (i == '(') {
            val = val + 1;
        } else {
            val = val - 1;
        }
        if (val < 0) {
            return false;
        }
    }
    return val == 0;
}

string match_parens(vector<string> lst){
    string S1 = lst[0] + lst[1];
    string S2 = lst[1] + lst[0];
    if (check(S1) || check(S2)) {
        return "Yes";
    } else {
        return "No";
    }
}

#undef NDEBUG
#include<assert.h>
int main(){
    assert (match_parens({"()(", ")"}) == "Yes");
    assert (match_parens({")", ")"}) == "No");
    assert (match_parens({"(()(())", "())())"}) == "No");
    assert (match_parens({")())", "(()()("}) == "Yes");
    assert (match_parens({"(())))", "(()())(("}) == "Yes");
    assert (match_parens({"()", "())"}) == "No");
    assert (match_parens({"(()(", "()))()"}) == "Yes");
    assert (match_parens({"((((", "((())"}) == "No");
    assert (match_parens({")(()", "(()("}) == "No");
    assert (match_parens({")(", ")("}) == "No");
    assert (match_parens({"(", ")"}) == "Yes");
    assert (match_parens({")", "("}) == "Yes" );
}

