string get_closest_vowel(string word) {
    if (word.length() < 3) {
        return "";
    }

    unordered_set<char> vowels = {'a', 'e', 'i', 'o', 'u', 'A', 'E', 'O', 'U', 'I'};
    for (int i = word.length() - 2; i > 0; i--) {
        if (vowels.find(word[i]) != vowels.end() && vowels.find(word[i-1]) == vowels.end() && vowels.find(word[i+1]) == vowels.end()) {
            return string(1, word[i]);
        }
    }
    return "";
}

