bool is_prime(int num) {
    if (num == 1 || num == 0) {
        return false;
    }
    if (num == 2) {
        return true;
    }
    for (int i = 2; i <= sqrt(num); i++) {
        if (num % i == 0) {
            return false;
        }
    }
    return true;
}

string intersection(vector<int> interval1, vector<int> interval2) {
    int l = max(interval1[0], interval2[0]);
    int r = min(interval1[1], interval2[1]);
    int length = r - l;
    if (length > 0 && is_prime(length)) {
        return "YES";
    }
    return "NO";
}

#undef NDEBUG
#include<assert.h>
