#include<stdio.h>
#include<math.h>
#include<vector>
using namespace std;
int prod_signs(vector<int> arr){
    if (arr.empty()) return -32768;
    int prod = 0;
    bool has_zero = false;
    int negative_count = 0;
    for (int num : arr) {
        if (num == 0) {
            has_zero = true;
            break;
        }
        if (num < 0) negative_count++;
    }
    if (has_zero) prod = 0;
    else prod = pow(-1, negative_count);

    int sum_magnitudes = 0;
    for (int num : arr) {
        sum_magnitudes += abs(num);
    }

    return prod * sum_magnitudes;
}

