int digits(int n){
    int product = 1;
    int odd_count = 0;
    std::string num_str = std::to_string(n);
    for(char digit : num_str){
        int int_digit = digit - '0';
        if(int_digit % 2 == 1){
            product *= int_digit;
            odd_count++;
        }
    }
    if(odd_count == 0){
        return 0;
    } else {
        return product;
    }
}

