boost::any compare_one(boost::any a, boost::any b) {
    std::string temp_a = boost::any_cast<std::string>(a);
    std::string temp_b = boost::any_cast<std::string>(b);

    if (temp_a.find(',') != std::string::npos) {
        std::replace(temp_a.begin(), temp_a.end(), ',', '.');
    }
    if (temp_b.find(',') != std::string::npos) {
        std::replace(temp_b.begin(), temp_b.end(), ',', '.');
    }

    if (std::stod(temp_a) == std::stod(temp_b)) {
        return boost::any();
    }

    return std::stod(temp_a) > std::stod(temp_b) ? a : b;
}

