using namespace std;
string fix_spaces(string text){
    string new_text = "";
    int start = 0, end = 0;
    for (int i = 0; i < text.size(); i++) {
        if (text[i] == ' ') {
            end++;
        } else {
            if (end - start > 2) {
                new_text += "-";
            } else if (end - start > 0) {
                new_text += string(end - start, '_');
            }
            new_text += text[i];
            start = i + 1;
            end = i + 1;
        }
    }
    if (end - start > 2) {
        new_text += "-";
    } else if (end - start > 0) {
        new_text += "_";
    }
    return new_text;
}

