int digits_sum(int n) {
    int neg = 1;
    if (n < 0) {
        n *= -1;
        neg = -1;
    }
    string num_str = to_string(n);
    int sum = 0;
    for (char c : num_str) {
        sum += c - '0';
    }
    return sum * neg;
}

vector<int> order_by_points(vector<int> nums) {
    sort(nums.begin(), nums.end(), [&nums](int a, int b) {
        if (digits_sum(a) == digits_sum(b)) {
            return find(nums.begin(), nums.end(), a) - nums.begin() < find(nums.begin(), nums.end(), b) - nums.begin();
        }
        return digits_sum(a) < digits_sum(b);
    });
    return nums;
}

