vector<string> bf(string planet1, string planet2) {
    vector<string> planet_names = {"Mercury", "Venus", "Earth", "Mars", "Jupiter", "Saturn", "Uranus", "Neptune"};

    if (find(planet_names.begin(), planet_names.end(), planet1) == planet_names.end() || find(planet_names.begin(), planet_names.end(), planet2) == planet_names.end() || planet1 == planet2) {
        return {};
    }

    int planet1_index = find(planet_names.begin(), planet_names.end(), planet1) - planet_names.begin();
    int planet2_index = find(planet_names.begin(), planet_names.end(), planet2) - planet_names.begin();

    vector<string> result;
    if (planet1_index < planet2_index) {
        for (int i = planet1_index + 1; i < planet2_index; i++) {
            result.push_back(planet_names[i]);
        }
    } else {
        for (int i = planet2_index + 1; i < planet1_index; i++) {
            result.push_back(planet_names[i]);
        }
    }

    return result;
}

