string Strongest_Extension(string class_name, vector<string> extensions) {
    string strongest = extensions[0];
    int my_val = 0;
    for (char c : extensions[0]) {
        if (isalpha(c)) {
            if (isupper(c)) {
                my_val++;
            } else {
                my_val--;
            }
        }
    }
    for (const string& s : extensions) {
        int val = 0;
        for (char c : s) {
            if (isalpha(c)) {
                if (isupper(c)) {
                    val++;
                } else {
                    val--;
                }
            }
        }
        if (val > my_val) {
            strongest = s;
            my_val = val;
        }
    }
    return class_name + "." + strongest;
}

#undef NDEBUG
#include<assert.h>
int main(){
    assert (Strongest_Extension("Watashi", {"tEN", "niNE", "eIGHt8OKe"}) == "Watashi.eIGHt8OKe");
