string int_to_mini_roman(int number) {
    vector<int> num = {1, 4, 5, 9, 10, 40, 50, 90, 100, 400, 500, 900, 1000};
    vector<string> sym = {"I", "IV", "V", "IX", "X", "XL", "L", "XC", "C", "CD", "D", "CM", "M"};
    int i = 12;
    string res = "";
    while (number > 0) {
        int div = number / num[i];
        number %= num[i];
        while (div > 0) {
            res += sym[i];
            div--;
        }
        i--;
    }
    for (char &c : res) {
        c = tolower(c);
    }
    return res;
}

