std::vector<int> intersperse(std::vector<int> numbers, int delimiter) {
    std::vector<int> result;

    if (numbers.empty()) {
        return result;
    }

    for (size_t i = 0; i < numbers.size() - 1; i++) {
        result.push_back(numbers[i]);
        result.push_back(delimiter);
    }

    result.push_back(numbers.back());

    return result;
}

