using namespace std;

vector<int> parse_nested_parens(string paren_string) {
    vector<int> depths;
    int depth = 0;
    int max_depth = 0;

    for (char c : paren_string) {
        if (c == '(') {
            depth++;
            max_depth = max(depth, max_depth);
        } else if (c == ')') {
            depth--;
        } else if (c == ' ') {
            depths.push_back(max_depth);
            max_depth = 0;
            depth = 0;
        }
    }

    depths.push_back(max_depth); // Add the last max_depth value
    return depths;
}

