using namespace std;

float mean_absolute_deviation(vector<float> numbers) {
    float sum = 0;
    for (float num : numbers) {
        sum += num;
    }
    float mean = sum / numbers.size();

    float absolute_diff_sum = 0;
    for (float num : numbers) {
        absolute_diff_sum += abs(num - mean);
    }

    return absolute_diff_sum / numbers.size();
}

