vector<int> parse_music(string music_string) {
    unordered_map<string, int> note_map = {{"o", 4}, {"o|", 2}, {".|", 1}};
    vector<int> result;
    string note = "";
    for (char c : music_string) {
        if (c == ' ') {
            if (!note.empty()) {
                result.push_back(note_map[note]);
                note = "";
            }
        } else {
            note += c;
        }
    }
    if (!note.empty()) {
        result.push_back(note_map[note]);
    }
    return result;
}

